import Layout from '../components/MyLayout';
import TimeTable from '../components/TimeTable';

const Index = () => (
    <div>
        <Layout>
        <h1>It's CRUD time!</h1>
        <div>
          <h2>View users</h2>
          <TimeTable />
        </div>
        </Layout>
    </div>
  );

export default Index;
